const ApplyButton = () => {
    return (
        <div className='fixed left-0 bottom-0 items-center'>
            <div className='border mx-4 my-4 px-8 bg-black w-full'>
                <button>시간제 보험심사 신청하기</button>
            </div>
        </div>
    )
}
export default ApplyButton;
